import * as React from 'react'
import { useState } from 'react';

import Diary from './components/Diary';
import Explore from './components/Explore';
import Profile from './components/Profile';
import Statistics from './components/Statistics';
import HomePage from './components/HomePage';

import Explore1 from './components/Explore1';
import Explore2 from './components/Explore2';
import Explore3 from './components/Explore3';
import Explore4 from './components/Explore4';
import Explore5 from './components/Explore5';
import Explore6 from './components/Explore6';
import Explore7 from './components/Explore7';
import Explore8 from './components/Explore8';
import Explore9 from './components/Explore9';
import Explore10 from './components/Explore10';
import Explore11 from './components/Explore11';
import Explore12 from './components/Explore12';
import Explore13 from './components/Explore13';
import Explore14 from './components/Explore14';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import 'react-native-gesture-handler';


const Stack = createStackNavigator();

const App = () => {

  return (
    <NavigationContainer>

      <Stack.Navigator initialRouteName="HomeActivity"
        screenOptions={{ headerShown: false }} initialRouteName="Home">

        <Stack.Screen
          name="Explore"
          component={Explore}
        />


        <Stack.Screen
          name="ExploreOne"
          component={Explore1}
        />
        <Stack.Screen
          name="Explore2"
          component={Explore2}
        />
        <Stack.Screen
          name="Explore3"
          component={Explore3}
        /> <Stack.Screen
          name="Explore4"
          component={Explore4}
        /> <Stack.Screen
          name="Explore5"
          component={Explore5}
        /> <Stack.Screen
          name="Explore6"
          component={Explore6}
        /> <Stack.Screen
          name="Explore7"
          component={Explore7}
        /> <Stack.Screen
          name="Explore8"
          component={Explore8}
        /> <Stack.Screen
          name="Explore9"
          component={Explore9}
        /> <Stack.Screen
          name="Explore10"
          component={Explore10}
        /> <Stack.Screen
          name="Explore11"
          component={Explore11}
        /> <Stack.Screen
          name="Explore12"
          component={Explore12}
        /> <Stack.Screen
          name="Explore13"
          component={Explore13}
        /> <Stack.Screen
          name="Explore14"
          component={Explore14}
        />
        <Stack.Screen
          name="HomePage"
          component={HomePage} />

        <Stack.Screen
          name='Diary'
          component={Diary}
          options={{
            title: 'Dagbok',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#BD614E',
            },
          }}
        />


        <Stack.Screen
          name="Statistics"
          component={Statistics}
          options={{
            title: 'Statestik',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#C497A4',
            },
          }} />

        <Stack.Screen
          name="Profile"
          component={Profile}
          options={{
            title: 'Profil',
            headerTintColor: '#fff',
            headerStyle: {
              backgroundColor: '#CE7937',
            },
          }} />
      </Stack.Navigator>
    </NavigationContainer>

  )
}

export default App;
